DROP TABLE IF EXISTS optreden;
CREATE TABLE optreden( id INTEGER PRIMARY KEY AUTOINCREMENT, locatie TEXT, plaats TEXT, landCode TEXT, longitude REAL, latitude REAL, datum TEXT, tijd TEXT, isBuiten INTEGER, isSociaal INTEGER, isOpenbaar INTEGER, isBesloten INTEGER, isWildOp INTEGER, aantalBezoekers INTEGER, gastdirigent TEXT, opmerkingen TEXT );
DROP TABLE IF EXISTS stuk;
CREATE TABLE stuk( id INTEGER PRIMARY KEY AUTOINCREMENT, titel TEXT, componist TEXT, code TEXT, metSolistKlarinet INTEGER, metSolistZang INTEGER );
DROP TABLE IF EXISTS `optreden_repertoire`;
CREATE TABLE optreden_repertoire( optredenId INTEGER, stukId INTEGER, PRIMARY KEY (optredenId, stukId), FOREIGN KEY(optredenId) REFERENCES optreden (id) ON DELETE CASCADE, FOREIGN KEY(stukId) REFERENCES stuk (id) ON DELETE CASCADE );
